r($,"bMt","Et",()=>A.a([A.bcR("A Plataforma OBAMA \xe9 um reposit\xf3rio que faz a cataloga\xe7\xe3o de Objetos de Aprendizagem (OA) classificados a partir de crit\xe9rios pedag\xf3gicos e t\xe9cnicos, com conte\xfados explorados e habilidades que podem ser desenvolvidas em plataformas de funcionamento diferentes (desktop ou mobile). Al\xe9m do desenvolvimento do reposit\xf3rio para ajudar professores da Educa\xe7\xe3o B\xe1sica a encontrar recursos educativos digitais para diversificar as estrat\xe9gias de ensino de Matem\xe1tica em sala de aula, a OBAMA intenciona formar docentes para a busca, utiliza\xe7\xe3o e integra\xe7\xe3o dos OA em processos de ensino e aprendizagem. A plataforma tamb\xe9m tem mapeados e catalogados aplicativos voltados para o ensino da Matem\xe1tica segundo as habilidades trabalhadas na Prova Brasil e na Base Nacional Comum Curricular (BNCC). S\xe3o exemplos de OA\u2019s anima\xe7\xf5es, simula\xe7\xf5es, jogos educativos e softwares, os quais podem ser favoritados e at\xe9 compor planos virtuais de aulas, recurso permitido para docentes cadastrados na OBAMA.","O que n\xf3s fazemos?"),A.bcR("A hist\xf3ria do Obama come\xe7a no ano de 2010 com o professor Dennys Leite Maia, formado em Pedagogia, que na \xe9poca ainda era estudante de Mestrado na Universidade Estadual do Cear\xe1 (UECE) e fazia muitas forma\xe7\xf5es de professores mostrando os objetos de aprendizagem e tecnologias digitais.\n\nA principal tecnologia existente nesse per\xedodo eram os objetos de aprendizagem e durante as forma\xe7\xf5es, Dennys Leite apresentava uma lista com 8 a 10 reposit\xf3rios para as pessoas identificarem, guardarem os endere\xe7os e buscarem os objetos de aprendizagem.\n\nDurante as forma\xe7\xf5es, ele percebeu a dificuldade dos professores, seja porque tinham pouca flu\xeancia tecnol\xf3gica ou porque n\xe3o lembravam qual era o objeto e em qual reposit\xf3rio estava. Diante desse cen\xe1rio, Dennys percebeu que seria \xf3timo se existisse um ambiente que armazenasse, de forma organizada, todos os objetos de aprendizagem e os professores s\xf3 tivessem a preocupa\xe7\xe3o de identificar as habilidades que desejassem trabalhar com os alunos.\n\nAp\xf3s terminar o Mestrado, Dennys assumiu como professor substituto na UECE, na \xe1rea de tecnologia educacionais e Educa\xe7\xe3o em Matem\xe1tica e junto com o os bolsistas de inicia\xe7\xe3o cient\xedfica do Grupo de Pesquisa Matem\xe1tica e Ensino (MAES), teve a ideia de criar um reposit\xf3rio e assim nasceu o Obama (Objetos de Aprendizagem de Matem\xe1tica).\n\nO Obama foi lan\xe7ado em 2013  como um Google Site, que consistia em uma lista com os t\xedtulos dos objetos e com os links para onde eles estavam hospedados. Quem usasse o site tinha que fazer uma busca manual (teclas ctrl +f), usando o nome do objeto ou palavras chaves para encontrar o objeto desejado.\n\nDurante as forma\xe7\xf5es, Dennys Leite recebia feedback positivos dos professores pois o reposit\xf3rio ajudava muito, mesmo com limita\xe7\xf5es de design de interface e de interatividade, pois j\xe1 reunia metadados relevantes para a classifica\xe7\xe3o e busca de OA, como: n\xedvel de ensino, blocos de conte\xfados e descritores da Prova Brasil, al\xe9m de possuir mais de 260 Objetos de Aprendizagem do tipo anima\xe7\xe3o/simula\xe7\xe3o.\n\nCom a aprova\xe7\xe3o no concurso da Universidade Federal do Rio Grande do Norte, no final de 2014, o professor Dennys Leite se mudou para a capital potiguar e o projeto passou a fazer parte do Grupo Interdisciplinar de Estudos e Pesquisas em Inform\xe1tica na Educa\xe7\xe3o (GIIFE), vinculado ao Instituto Metr\xf3pole Digital (IMD) da UFRN.\n\nEm 2016  o projeto tomou corpo com a aprova\xe7\xe3o do projeto de pesquisa \u201cObjetos de Aprendizagem para o ensino de Matem\xe1tica: pesquisa, forma\xe7\xe3o e desenvolvimento\u201d, aprovado pela Pr\xf3-Reitoria de Pesquisa da UFRN.\n\nHouve a primeira sele\xe7\xe3o de bolsista do projeto, com o prop\xf3sito de avan\xe7ar na concep\xe7\xe3o do reposit\xf3rio e criar mecanismos para melhorar a busca a partir dos crit\xe9rios utilizados anteriormente e outros crit\xe9rios pedag\xf3gicos como as habilidades da Base Nacional Comum Curricular (BNCC).Foi necess\xe1rio atualizar e aperfei\xe7oar a estrutura do OBAMA. A atualiza\xe7\xe3o do reposit\xf3rio de OA para Matem\xe1tica, empreendida pelo IMD/UFRN, ficou conhecida como \u201cOBAMA 2.0\u201d e teve seu lan\xe7amento em 2017 no II Congresso sobre Tecnologias na Educa\xe7\xe3o (Ctrl+E 2017), na Para\xedba, onde foi lan\xe7ado como reposit\xf3rio com sistema de busca e recebeu pr\xeamio de melhor oficina durante o evento.\n\nO grande diferencial era o sistema de busca, utilizando os crit\xe9rios de habilidade das \xe1reas de conhecimento da matem\xe1tica e habilidades da BNCC, se tornando refer\xeancia e sendo utilizado atualmente em outros reposit\xf3rios de recursos educativos.\n\nA partir de 2018 foi implementada a fun\xe7\xe3o de plano de aula onde a pessoa pode criar um planejamento de aula vinculando um OA (ou n\xe3o) e podendo compartilhar, transformando o Obama em uma plataforma. No mesmo ano, o Obama conquistou o segundo lugar como melhor prot\xf3tipo do Congresso Brasileiro de Inform\xe1tica na Educa\xe7\xe3o (CBIE).\n\nEm 2019 a plataforma passou a ofertar trilhas de aprendizagem, ou seja, tutoriais de uso simples, dispon\xedveis para google classroom, google forms, google meet, gmail e forma\xe7\xf5es (Conhecendo a Plataforma Obama, Desenvolvimento de Pr\xe1ticas Inovadoras em Matem\xe1tica e Uso Pedag\xf3gico do Smartphone nas Aulas de Matem\xe1tica, Ferramentas colaborativas do Google Drive, ferramentas do Google for education e visita t\xe9cnica).\n\nAtualmente, a maioria dos OAs dispon\xedveis no OBAMA s\xe3o oriundos de institui\xe7\xf5es produtoras ou que hospedam os recursos, mas tamb\xe9m contam com alguns desenvolvidos diretamente ou em parceria pela equipe do Obama como o OA bicalculo, dispon\xedvel na plataforma desde 2016. O Obama conta com vinte e tr\xeas fontes de OA para desktop e sete reposit\xf3rios de apps educativos. Portanto, em um \xfanico reposit\xf3rio, professores passam a ter acesso a trinta bases diferentes de recursos educativos digitais para a Matem\xe1tica.Hoje fazem parte do projeto professores do IMD e estudantes do curso t\xe9cnico e de bacharelado em Tecnologia da Informa\xe7\xe3o e dos cursos de Licenciatura em Matem\xe1tica e Pedagogia.","Nossa Hist\xf3ria")],A.ap("r<TF>")))
